import React from 'react'
import Product from './Product.js'

function ProductList(props) {
    const product =props.ProductList.map((product)=>{
      return <ul>
          <li>{product.model}</li>
      </ul>  
    })
    return (
            <table>
                <tr>
                    <th>Name</th>
                    <th>Price</th>
                </tr>
                

            </table>
              /*{
                return <Product product={product} key={i}/>
                }*/
        )
    
}

export default ProductList
